import {useState,useEffect} from 'react'

const Skills = () => {

    const [skillContainers,setOpen] = useState(
        {
            title:"All",
            open:true,
            content:"Java, Python, Swift, Javascript, HTML, CSS, React, Bootstrap5, Github, Android Studio, Data Mapping"
        },
        {
            title:"Languages",
            open:false,
            content:"Java, Python, Swift, Javascript, HTML, CSS"
        },
        {
            title:"Software",
            open:false,
            content:"React, Bootstrap5, Github, Android Studio"
        },
        {
            title:"Other",
            open:false,
            content:"Data Mapping, Adobe Prepare tools"
        }
    )

    return (
        <section id="skills">
            <h1 className="sectionTitle">Skills<span className="punctuation">.</span></h1>
            <div>
                {
                    skillContainers.map((skillContainer) => (
                        <SkillContainer 
                        title={skillContainer.title}
                        open={skillContainer.open}
                        content={skillContainer.content}
                        />))
                }
            </div>
        </section>
    )
}

export default Skills
